'            UPDATE ad_avaliacao_item ai'||wwv_flow.LF||
'                SET nr_escolha = trunc(DBMS_RANDOM.VALUE(1,4)),'||wwv_flow.LF||
'                    vl_escolha = (SELECT decode( trunc(DBMS_RANDOM.VALUE(1,4)), 1, ac.vl_conceito_1, '||wwv_flow.LF||
'                                                            2, ac.vl_conceito_2, '||wwv_flow.LF||
'                                                            3, ac.vl_conceito_3, '||wwv_flow.LF||
'                              '||
'                              4, ac.vl_conceito_4, 0) vl_escolha'||wwv_flow.LF||
'                                    FROM ad_competencia ac'||wwv_flow.LF||
'                                    WHERE CASE'||wwv_flow.LF||
'                                            WHEN ai.id_indicador BETWEEN 1 AND 3 THEN'||wwv_flow.LF||
'                                            1'||wwv_flow.LF||
'                                            WHEN ai.id_indicador BETWEEN 4 AND 11 THEN'||wwv_flow.LF||
'          '||
'                                  2'||wwv_flow.LF||
'                                            WHEN ai.id_indicador BETWEEN 12 AND 15 THEN'||wwv_flow.LF||
'                                            3'||wwv_flow.LF||
'                                        END = ac.id);'
    ,p_created_by => 'GEROTAVIO@GMAIL.COM'
    ,p_created_on => to_date('202202011913','YYYYMMDDHH24MI')
    ,p_parsed_schema => 'WKSP_CELOS');
end;
